export default function AlcholFix(){

    const [data, setData] = useState([])
    useEffect(() => {
      
      const fetchData = async () => {
        
        try{
          const query = `*[_type == "calculations" && id == "alkol_sayac"]`
          const result = await sanityClient.fetch(query)
          setData(result[0])
        }
        catch(err){
          console.log("Veri çekilirken hata meydana geldi!", err)
        }
  
      }
  
      fetchData()
  
    }, [])

    const [temprature, setTemprature] = useState(25) // 0-40
    const [alcholVolume, setAlcholVolume] = useState(98) // 1-100
    const [result, setResult] = useState(null)

    const [error, setError] = useState(false)

    useEffect(() => {

        const temp = parseFloat(temprature)
        const alchol = parseFloat(alcholVolume)

        if(temp > 40 || temp < 0 || alchol > 100 || alchol < 1){
            setError("Sıcaklık değeri 0 ile 40 arasında, alkol değeri 1 ile 100 arasında olmalıdır!")
        }
        else{
            setError(false)
            const res = table[Math.round(temp)][Math.round(alchol) - 1]
            setResult(res)
        }
        
    },[temprature, alcholVolume])



    return(
        <div className="calc-container">

            <div className="calc-header">
                <div className="calc-icon">
                    <img src="/icons/alkolfix.png" alt="" />
                </div>

                <h1 className="calc-title">
                    {data?.title}
                </h1>
            </div>
            
            <div className="calc-bottom">
                <div className="calc-inputs">
                    <Input title="Alkol Sıcaklığı" unit="°C" value={temprature} setter={setTemprature} />
                    <Input title="Alkol İçeriği" unit="%(hacim)" value={alcholVolume} setter={setAlcholVolume} />
                </div>

                <div className="calc-result">
                    {!error ? (
                        <div className="flex justify-between w-full pt-2">
                            <span>Gerçek Alkol İçeriği :</span>
                            <span><b>{result}</b> %</span>
                        </div>
                    ) : (
                        <div className="pt-2 w-full text-red-500">
                            {error}
                        </div>
                    )}
                </div>
            </div>

            {data?.accordions?.length > 0 && (
                data.accordions.map((accordion, index) => (
                <Accordion title={accordion.title} content={accordion.content} key={index} />
                ))
            )}
        </div>
    )
}